INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (171,'015','옛사람의 무덤 위다 다시 현재 사람이 장사를 지내는 격입니다. 두 사람의 마음이 각각 다른데 어찌 불리하지 않겠습니다. 악과 귀가 일치하고 좀우가 충돌하지 않도록 주의해야합니다. 만일 친함이 아니면 가정에 불안한 일이 생길지도 모르니 화합에 유념해야합니다. 만약에 목명되어 이동하면 손재수와 구설수가 면치 어려우니 분수를 지켜서 안주함이 옳겠습니다. 처음에는 곤하고 뒤에는 형통하게 될 것이니 마침내 길함이 있을 것입니다. 일이 순조롭게 잘 풀려 나갈 것입니다. 그러나 신상에 근심이 있으니 어찌 하겠습니까? 동쪽 이웃은 봄이 될만하나 서쪽 이웃은 이르지 못하겠습니다. 비록 험물은 있어도 고치면 귀하게 될 것입니다. 웃고 또 말함에 눈이 일을 막지 못하므로 말조심을 해야합니다.','여수가 불길하여 부만나 친 가족에게 환란이 미칠 수 있으니 주의하십시오. 비록 일은 생겨 진행할 수 있지만 뜻대로 대지 않으니 이를 어찌 하겠습니까? 동방의 귀인이 우연히 도와주니 일을 새로 얻어 활기를 띄게 될 것입니다.','일을 함에 소인에 길함이 있고 일을 마무르 찾는데 성심을 다해야합니다. 신상에 근심이 있으나 의수는 대길합니다. 봄바람이 부는 이월에는 도화가 만발하였으니 신상근심만 이기면 매우 즐겁겠습니다.','마음이 안정되지 못하여 일정한 주장을 내세우지 못하니 신자는 꿈속까지 생활합니다. 그러나 흉함이 변하여 길하게되고 차명 큰 이익을 보게 될 것입니다. 조상이 문에 비치는데 어찌 재물이 스스로 들어오지 않겠습니까?','재물이 산과 같이 쌓였으니 보기만 해도 넉넉하고 마음이 스스로 편안합니다. 사방에 길함이 있으니 반드시 재물을 얻게됩니다. 특히 일을 마무르 짓을 때 기회를 잘 포착하십시오. 꿈이 불길하여 일마다 험되기 쉬우나 이런 때일수록 친착하게 행동하시면 만사가 평탄하게 됩니다.','터가 발동하니 이사를 하거나 새것을 도모하여 털을 옮겨보는 것도 괜찮겠습니다. 만약 새집을 마련하거나 새것을 찾아 경영한다면 흉함이 변하여 길하게됩니다. 그러나 망동하진 마십시오. 험험된 생각으로 장사를 잘못 버리면 크게 실패할 지도 모릅니다.','만약 시비를 생기지 않는다면 구설수가 생길 것이니 남의 일을 간섭하지 마십시오. 생소한 사람은 가까이 할수록 실패를 가져다 줄 것입니다. 오래된 것일수록 안전함을 아십시오. 고요하게 마음을 가라앉히고 부구히 일에 임하면 대길하고 잘못 욕심이면 해가 있습니다.','나부에서 고기를 구하니 그맛에 맛을 얻음과 어찌 다르겠습니까? 몸이 길 위에 있으니 사방이 내집 이겠습니다. 외갈이 이와 같은데 무엇이 망령겠습니까? 이익은 남방에 있으니 그곳에서 보람을 느끼고 큰 발전을 이루게 되니 힘껏 추진하게됩니다.','마음속에 바램이 스어 있으니 즉시 구하려 들면 구해줄 것입니다. 의복이 몸에 따르는데 마침내 재물을 얻지 못하겠습니까? 운진의 소망이 쉽게 성공될 것입니다. 동쪽과 서쪽 양방에서 뜻밖의 재물을 얻을 것이니 시작함과 끝맞음을 중시하십시오.','의수는 적나 좋은 편인데 얻어서 밖은 앗게되니 이게 앞일입니까? 이로 인하여 구설수가 따르지도 모르니 사람이 착고 갈무리는 것이 더 좋을 것입니다. 의수가 불길하니 다른 재물을 탐하지 마십시오. 요히려 얻으려 하다가 그만큼 앗게 됩니다.','높시를 푸른 강에 던졌으니 반드시 큰고기를 얻게 될 것입니다. 그러나 물귀신이 이름을 흐려하고 있으니 물과 불을 조심해야합니다. 여인을 하게 될 수도 있습니다. 혹 관재의 길이 있을 수도 모르니 기도하여 흉을 면하게되길 바랍니다.','작은 소가 낙을 얻었으니 천리 길을 가기에는 무리가 많음과 같습니다. 동짓달과 섣달에는 매사를 이루기가 어려우니 너무 무거운 짐을 지지 않도록 주의하시기 바랍니다. 이익을 챙한다면 다른 데 가면 불리하니 밖으로 탐하지 말고 분수를 지켜야합니다.','신상에 위태함이 있으니 거동함